import React, { Component } from 'react';
import syle from '../GetDataPage/GetDataPage.css';
import axios from 'axios';

class GetDataPage extends Component {
    state = {
        temperature: undefined,
        waterLevel: undefined,
        moisture: undefined
    };

    call_rest = () => {
        const apiCall = axios.get(`http://localhost:8080/getData`).then(response => {
            console.log(response);
            if (response) {
          
                this.setState({
                  temperature: response.data.temperature,
                  moisture: response.data.moisture,
                  waterLevel: response.data.waterLevel
                });
              }
          });
    }

    render() {
        console.log("HERE");
        this.call_rest();

        return (
            <div className="wrapper">
                <div className="element">
                    <div>Temperture</div>
                    <div>{this.state.temperature}</div>
                </div>

                <div className="element">
                    <div>Moister</div>
                    <div>{this.state.moister}</div>
                </div>

                <div className="element">
                    <div>Water Level</div>
                    <div>{this.state.level}</div>
                </div>

            </div>
        );
    }
}

export default GetDataPage;
